import React from "react";

//////////////
export interface GetProps<P = {}> extends React.FC<P> {
  getInitialProps?: (context: any) => Promise<P>;
}

const Landing: GetProps<any> = ({ test }) => {
  return (
    <div>
      <h1>Landing</h1>
      <p>{test}</p>
    </div>
  );
};

Landing.getInitialProps = async () => {
  const test = "yes";
  return { test };
};

export default Landing;
